import { motion } from 'framer-motion';

const App = () => {
  return (
    <motion.div 
      animate={{ opacity: 1 }} 
      initial={{ opacity: 0 }} 
      transition={{ duration: 2 }}
    >
      <h1>Framer Motion Animation</h1>
    </motion.div>
  );
};




export default Home;
